import React, { useContext } from 'react'
import { contextData } from './Context'

export const LabelTwo = () => {
    const[data]=useContext(contextData)
    return (
        <div className='label2parent'>
            {data.filter((x)=>x.id>7&&x.id<15).map((x)=>{
                if(x.id==8){
                return(
                    <div className='childl2'><hr className='hrstl2'/>
                    <img src={x.image} height={'180px'}/>
                    <span className='textl2'>
                    <h4>{x.title}</h4>
                    <p>{x.content.slice(0,100)}</p>
                    {x.category}/{x.date}
                    </span>
                    </div>
                )}else{
                return(
                    <div><hr className='hrstl2'/>
                     <img src={x.image}/>
                    <h4>{x.title}</h4>
                    <p>{x.content.slice(0,100)}</p>
                    {x.category}/{x.date}
                    </div>
                    )  
                }
            })}
        </div>
    )
}
